    return(
        <div className="plant">
           {prop.currentItems.length?<MG mg={prop.currentItems}/>:<div style={{color:"gray",margin:"auto",padding:"50px",backgroundColor:"yellow",width:"50%"}}><h1>Next Plant&gt;&gt;&gt;</h1></div>}
            
        </div>
    
    )
}
